import React from 'react';
import {Signup} from "./components/signup";
import {Signin} from "./components/signin"
import {Route, Router} from "react-router-dom";
import {Switch} from "react-router";

function App() {
  return (
      <Router>
          <Switch>
              <Route path="/signup">
                  <Signup/>
              </Route>
              <Route path="/">
                  <Signin/>
              </Route>
          </Switch>
      </Router>
  );
}

export default App;
